function alice_feed(){var e=[],n=new google.feeds.Feed(alice_feedUrl("http://www.nbcnewyork.com/news/top-stories/?rss=y&embedThumb=y&summary=y"));n.setNumEntries(2),n.load(function(n){if(!n.error)for(var t=document.getElementById("feed"),l=0;l<n.feed.entries.length;l++)e+="<ul><li><a href='"+n.feed.entries[l].link+"' target='_blank'>"+n.feed.entries[l].title+"</a></li>"+n.feed.entries[l].content+"<br /><br /><small>"+new Date(n.feed.entries[l].publishedDate)+"<br /><br /></small></ul>",t.innerHTML=e})}function alice_feedUrl(e){return e}google.load("feeds","1"),google.setOnLoadCallback(alice_feed);
